iews = N_reviews.value;\n    var price = price.value;\n    var priceUP   = priceUP.value;\n    var reviewUP = reviewUP.value;\n\n\n    // If slider for price is at maximum, take it to 'infinity'  \n    if (price[1] &gt;=400){\n        price[1] = Math.max(...data2['price'])\n    }\n    \n    //create mask\n    var mask1 = data2['N_review'].map(item =&gt; item &gt; N_reviews);\n    var mask2 = data2['price'].map( item =&gt; item &gt;=price[0] &amp;&amp; item &lt;=price[1]);\n    var mask3 = data2['Slope_price'].map(item =&gt; item*priceUP &gt;= 0);\n    var mask4 = data2['Slope_rating'].map(item =&gt; item*reviewUP &gt;= 0);\n    \n    //multiply masks\n    mask = mask1.map((item,i) =&gt; mask1[i]*mask2[i]*mask3[i]*mask4[i])\n    \n    //filter by mask\n    data['N_rating']     = data2['N_rating']    .filter((item,i) =&gt; mask[i]);\n    data['N_review']     = data2['N_review']    .filter((item,i) =&gt; mask[i]);\n    data['Slope_price']  = data2['Slope_price'] .filter((item,i) =&gt; mask[i]);\n    data['Slope_rating'] = data2['Slope_rating'].filter((item,i) =&gt; mask[i]);\n    data['asin']         = data2['asin']        .filter((item,i) =&gt; mask[i]);\n    data['colors']       = data2['colors']      .filter((item,i) =&gt; mask[i]);\n    data['corr']         = data2['corr']        .filter((item,i) =&gt; mask[i]);\n    data['price']        = data2['price']       .filter((item,i) =&gt; mask[i]);\n    data['radii']        = data2['radii']       .filter((item,i) =&gt; mask[i]);\n    data['rating']       = data2['rating']      .filter((item,i) =&gt; mask[i]);\n\n\n// check the data in console    \n//    console.log('mask', mask.reduce((a, x) =&gt; a + x));\n//    for (var key in data){\n//      console.log( key, data[key] );\n//    }\n    \n\n    source.change.emit();\n"},"id":"768113ab-768e-4e4e-82c3-7215e6a1ab17","type":"CustomJS"},{"attributes":{"callback":{"id":"768113ab-768e-4e4e-82c3-7215e6a1ab17","type":"CustomJS"},"end":1,"start":-1,"title":"Review trend -&gt; Up
